(7, 'Jasprit Bumrah ruled out of England T20I series due to injury', 3, 4, '<h3 style=\"margin-bottom: 15px; padding: 0px;\"><span style=\"margin: 0px; padding: 0px;\"><b>The Indian Cricket Team has received a huge blow right ahead of the commencement of the much-awaited series against England. Star speedster Jasprit Bumrah has been ruled out of the forthcoming 3-match T20I series as he suffered an injury in his left thumb.</b></span></h3><p style=\"margin-bottom: 15px; padding: 0px; font-size: 16px; font-family: PTSans, sans-serif;\">The 24-year-old pacer picked up a niggle during India\'s first T20I match against Ireland played on June 27 at the Malahide cricket ground in Dublin. As per the reports, he is likely to be available for the ODI series against England scheduled to start from July 12.</p><p style=\"margin-bottom: 15px; padding: 0px; font-size: 16px; font-family: PTSans, sans-serif;\">In the first, Bumrah exhibited a phenomenal performance with the ball. In his quota of four overs, he conceded 19 runs and picked 2 wickets at an economy rate of 4.75.</p><p style=\"margin-bottom: 15px; padding: 0px; font-size: 16px; font-family: PTSans, sans-serif;\">Post his injury, he arrived at team\'s optional training session on Thursday but didn\'t train. Later, he was rested in the second face-off along with MS Dhoni, Shikhar Dhawan and Bhuvneshwar Kumar.</p><p style=\"margin-bottom: 15px; padding: 0px; font-size: 16px; font-family: PTSans, sans-serif;\">As of now, no replacement has been announced. However, Umesh Yadav may be be given chance in the team in Bumrah\'s absence.</p><p style=\"padding: 0px; font-size: 16px; font-family: PTSans, sans-serif;\">The first T20I match between India and England will be played at Old Trafford, Manchester on July 3.</p>', '2018-06-30 18:49:23', '2021-03-24 13:11:52', 1, 'Jasprit-Bumrah-ruled-out-of-England-T20I-series-due-to-injury', 'ae566253288191ce5d879e51dae1d8c3.jpg', NULL, 11, 1),
(10, 'Tata Steel, Thyssenkrupp Finalise Landmark Steel Deal', 7, 9, '<h3 style=\"box-sizing: inherit; margin-top: 0px; padding: 0px; line-height: normal;\"><font face=\"Courier New\"><span itemprop=\"headline\" style=\"box-sizing: inherit;\">Tata Steel, Thyssenkrupp Finalise Landmark Steel Deal</span>Tata Steel, Thyssenkrupp Finalise Landmark Steel DealTata Steel,</font></h3><h3 style=\"box-sizing: inherit; margin-top: 0px; padding: 0px; line-height: normal;\"><font face=\"Courier New\"> Thyssenkrupp Finalise Landmark Steel DealTata Steel, Thyssenkrupp Finalise Landmark Steel DealTata Steel, Thyssenkrupp Finalise Landmark Steel Deal</font></h3>', '2018-06-30 19:08:56', '2021-03-23 22:02:43', 1, 'Tata-Steel,-Thyssenkrupp-Finalise-Landmark-Steel-Deal', '156005c5baf40ff51a327f1c34f2975b.jpg', NULL, 1, 0),
(11, 'UNs Jean Pierre Lacroix thanks India for contribution to peacekeeping', 6, 8, '<p>UNs Jean Pierre Lacroix thanks India for contribution to peacekeepingUNs Jean Pierre Lacroix thanks India for contribution to peacekeepingUNs Jean Pierre Lacroix thanks India for contribution to peacekeeping</p><p>UNs Jean Pierre Lacroix thanks India for contribution to peacekeepingUNs Jean Pierre Lacroix thanks India for contribution to peacekeepingUNs Jean Pierre Lacroix thanks India for contribution to peacekeeping</p><p>UNs Jean Pierre Lacroix thanks India for contribution to peacekeepingUNs Jean Pierre Lacroix thanks India for contribution to peacekeepingUNs Jean Pierre Lacroix thanks India for contribution to peacekeeping</p><p>UNs Jean Pierre Lacroix thanks India for contribution to peacekeepingUNs Jean Pierre Lacroix thanks India for contribution to peacekeepingUNs Jean Pierre Lacroix thanks India for contribution to peacekeeping</p><p>UNs Jean Pierre Lacroix thanks India for contribution to peacekeepingUNs Jean Pierre Lacroix thanks India for contribution to peacekeepingUNs Jean Pierre Lacroix thanks India for contribution to peacekeeping</p><p>UNs Jean Pierre Lacroix thanks India for contribution to peacekeepingUNs Jean Pierre Lacroix thanks India for contribution to peacekeeping<br></p>', '2018-06-30 19:10:36', '2021-03-23 17:19:01', 1, 'UNs-Jean-Pierre-Lacroix-thanks-India-for-contribution-to-peacekeeping', '27095ab35ac9b89abb8f32ad3adef56a.jpg', NULL, 1, 0),
(12, 'Shah holds meeting with NE states leaders in Manipur', 6, 7, '<p><span style=\"color: rgb(25, 25, 25); font-family: &quot;Noto Serif&quot;; font-size: 16px;\">New Delhi: BJP president Amit Shah today held meetings with his party leaders who are in-charge of 11 Lok Sabha seats spread across seven northeast states as part of a drive to ensure that it wins the maximum number of these constituencies in the general election next year.</span><br style=\"box-sizing: inherit; color: rgb(25, 25, 25); font-family: &quot;Noto Serif&quot;; font-size: 16px;\"><br style=\"box-sizing: inherit; color: rgb(25, 25, 25); font-family: &quot;Noto Serif&quot;; font-size: 16px;\"><webviewcontentdata style=\"box-sizing: inherit; color: rgb(25, 25, 25); font-family: &quot;Noto Serif&quot;; font-size: 16px;\">Shah held separate meetings with Lok Sabha toli (group) of Arunachal Pradesh, Tripura, Meghalaya, Mizoram, Nagaland, Sikkim and Manipur in Manipur, the partys media head Anil Baluni said.<br style=\"box-sizing: inherit;\"><br style=\"box-sizing: inherit;\">Baluni said that Shah was in West Bengal for two days before he arrived in Manipur. The BJP chief would reach Odisha tomorrow.</webviewcontentdata><br></p>', '2018-06-30 19:11:44', '2021-03-23 15:27:58', 1, 'Shah-holds-meeting-with-NE-states-leaders-in-Manipur', '7fdc1a630c238af0815181f9faa190f5.jpg', NULL, 1, 0),
(13, 'Dr John Pombe Magufuli dies ', 6, 8, '<p><span class=\"surtitre\"></span></p><p>Perezida Paul Kagame yihanganishije abaturage ba Tanzania nyuma y\'urupfu rwa John Pombe Joseph Magufuli uheruka kwitaba Imana azize uburwayi bw\'umutima, avuga ko yari intwari iharanira iterambere rya Afurika.</p><p><br></p><p>Umukuru w\'Igihugu yatanze ubu butumwa kuri uyu wa Gatanu, tariki ya 19 Werurwe 2021, ubwo yakiraga indahiro z\'abayobozi bashya baheruka kwinjira muri Guverinoma. Aba barimo Minisitiri w\'Ubutegetsi bw\'Igihugu n\'Imibereho Myiza, Gatabazi Jean Marie Vianney n\' uw\'Ubucuruzi n\'Inganda, Habyarimana B\'ata.</p><p><br></p><p>Magufuli wari Perezida wa Tanzania yitabye Imana ku wa 17 Werurwe aguye mu bitaro biri mu Murwa Mukuru wa Tanzania, Dar es Salaam; yazize indwara y\'umutima yari amaranye imyaka 10.</p><p><br></p><p>Ubwo yakiraga indahiro z\'abayobozi baherutse guhabwa inshingano, Perezida Kagame yihanganishije umuryango wa Magufuli, yafataga nk\'inshuti ndetse n\'impirimbanyi y\'iterambere ku Mugabane wa Afurika.</p><p><br></p><p>Yagize ati \'Sinasoza ntihanganishije umuryango wa Perezida John Pombe Joseph Mafuguli uherutse kwitaba Imana ndetse no ku gihugu cya Tanzania muri rusange. Perezida Magufuli yari umunyamurava ukunda Afurika kandi akaba inshuti y\'igihugu cyacu\'.</p><p><br></p><p>Perezada Kagame kandi yavuze ko u Rwanda rwifatanyije na Tanzania muri ibi bihe bikomeye by\'akababaro.</p><p><br></p><p>Ati \'U Rwanda rwifatanyije na Tanzania ndetse na Perezida Samia Suluhu Hassan muri ibi bihe bigoye\'.</p><p><br></p><p>Nyuma y\'urupfu rwa Perezida Magufuli, Perezida Kagame yanyujije ubutumwa ku rubuga rwa Twitter bwagaragaje akababaro yatewe no kubura inshuti ye.</p><p><br></p><p>Yagize ati \'Twababajwe no kubura umuvandimwe akaba n\'inshuti yanjye, Perezida Magufuli. Umusanzu we ku gihugu cye n\'Akarere kacu ntabwo bizibagirana.\'</p><p><br></p><p>Yakomeje agira ati \'Nihanganishije umuryango we n\'abaturage ba Tanzania. Abanyarwanda bifatanyije n\'Abanya-Tanzania muri ibi bihe bitoroshye.\'\'</p><p><br></p><p>Umubano mwiza hagati ya Perezida Kagame na Perezida Magufuli uherutse kwitaba Imana ni uwo kuva kera, ndetse warushijeho gutera imbere ubwo Magufuli yatorerwaga kuyobora Tanzania, akanakorera urugendo rwa mbere mpuzamahanga mu Rwanda, ndetse icyo gihe Perezida Kagame yamugabiye inka.</p><p><br></p><p>Ku ngoma ya Magufuli kandi u Rwanda na Tanzania byasinye amasezerano yo kubaka umuhanda wa gari ya moshi uzava Isaka muri Tanzania ukagera i Kigali.</p><p><br></p><p>Kugeza ubu, u Rwanda rwatangaje igihe cyo kunamira Magufuli watabarutse ku myaka 61, kikazarangira ku wa 25 z\'uku kwezi ari na bwo azashyingurwa.</p><p><br></p>', '2021-03-19 14:30:42', '2021-03-23 22:37:23', 1, 'Dr-John-Pombe-Magufuli-dies-', 'aedf042e6b985cbc9753fd32c5902224.png', NULL, 3, 1),
(14, 'Peter Okoye found heritage', 5, 3, '<p>uirhvvvrcdy</p><p>erjdjfjrrrr</p><p>rretydfghjcvb</p><p>rt<img style=\"width: 132px;\" src=\"data:image/png;base64,\" data-filename=\"LOckingKey.png\"><br></p>', '2021-03-20 12:17:33', '2021-03-23 17:23:24', 0, 'Peter-Okoye-found-heritage', '1fa02132983470287787d734b65d0f64.png', NULL, 0, 0);
INSERT INTO `tblposts` (`id`, `PostTitle`, `CategoryId`, `SubCategoryId`, `PostDetails`, `PostingDate`, `UpdationDate`, `Is_Active`, `PostUrl`, `PostImage`, `PostVideo`, `viewed`, `isSliding`) VALUES
(15, 'Singer Clarisse Karasira legally married', 13, 10, '<p><img src=\"data:image/jpeg;base64,\" data-filename=\"karasira1-3j53a1-bd4ee-cd98f.jpg\" style=\"width: 25%;\"><i style=\"color: rgb(25, 25, 25); font-family: igihelight; font-size: 19px; text-align: justify;\"><br></i></p><p><i style=\"color: rgb(25, 25, 25); font-family: igihelight; font-size: 19px; text-align: justify;\">Fast-rising Rwandan traditional singer Clarisse Karasira, has been legallmarried to her lover, Ifashabayo Sylvain Dejoie with whom they engaged in January 2021.</i></p><p><img src=\"data:image/jpeg;base64,\" data-filename=\"karasira4-2j4339-72a19-1ae1e.jpg\" style=\"width: 800px;\"><i style=\"color: rgb(25, 25, 25); font-family: igihelight; font-size: 19px; text-align: justify;\"><br></i></p><p style=\"margin-bottom: 10px; font-family: igihelight; font-size: 18px; color: rgb(38, 38, 38); text-align: justify;\">Their civil marriage was held at Rusororo sector, Gasabo district of Kigali city yesterday on Thursday 18th February 2021.</p><p style=\"margin-bottom: 10px; font-family: igihelight; font-size: 18px; color: rgb(38, 38, 38); text-align: justify;\">The civil marriage follows recent engagement on 8th January 2021 when Ifashabayo proposed to Karasira.</p><p style=\"margin-bottom: 10px; font-family: igihelight; font-size: 18px; color: rgb(38, 38, 38); text-align: justify;\">IGIHE has learnt that they are also planning for religious wedding in case Covid-19 restrictions are eased.</p><p style=\"margin-bottom: 10px; font-family: igihelight; font-size: 18px; color: rgb(38, 38, 38); text-align: justify;\">Clarisse Karasira met with Ifashabayo in 2017 during a concert organized in memory of late traditional singer Kamaliza.</p><p style=\"margin-bottom: 10px; font-family: igihelight; font-size: 18px; color: rgb(38, 38, 38); text-align: justify;\">Their friendship started when Ifashabayo who was part of the concert organizers went to invite Karasira.</p><p style=\"margin-bottom: 10px; font-family: igihelight; font-size: 18px; color: rgb(38, 38, 38); text-align: justify;\">It is said that Ifashabayo took over management of her affairs since 2019 after she parted ways with her then manager Alain Mukuralinda.</p><p style=\"margin-bottom: 10px; font-family: igihelight; font-size: 18px; color: rgb(38, 38, 38); text-align: justify;\">Karasira was expected to launch her first album in December last year but was later forced to postpone it due to stringent measures implemented following the spike in the Covid-19 infections and death toll.</p><p style=\"margin-bottom: 10px; font-family: igihelight; font-size: 18px; color: rgb(38, 38, 38); text-align: justify;\"><img src=\"data:image/jpeg;base64,\" data-filename=\"karasira5-2j8293-aa135-d3e10.jpg\" style=\"width: 836px;\"><br></p><p><br></p>', '2021-03-21 12:01:03', '2021-03-21 12:34:52', 0, 'Singer-Clarisse-Karasira-legally-married', 'f5b4106deae8cd4b8afc12b4635d21c4.jpg', NULL, 0, 0);
