-size: 18px; color: rgb(38, 38, 38); text-align: justify;\">Clarisse Karasira signs&nbsp;</p><p style=\"margin-bottom: 10px; font-family: igihelight; font-size: 18px; color: rgb(38, 38, 38); text-align: justify;\"><img src=\"data:image/jpeg;base64,\" data-filename=\"karasira4-2j4339-72a19-1ae1e.jpg\" style=\"width: 50%;\"></p>', '2021-03-21 12:37:51', '2021-03-23 17:23:31', 0, 'Singer-Clarisse-Karasira-legally-married', 'ba420c220a26e1f86967bfaa34038872.jpg', NULL, 0, 0);
