(17, 'WhatsApp: Now one billion people send 55 billion messages per day', 7, 9, '<p><span style=\"color: rgb(51, 51, 51); font-family: Arial; font-size: 12px;\">The eight-year old messaging app WhatsApp is now used by one billion people every day.</span><br class=\"autobr\" style=\"margin: 0px; padding: 0px; color: rgb(51, 51, 51); font-family: Arial; font-size: 12px;\"><span style=\"color: rgb(51, 51, 51); font-family: Arial; font-size: 12px;\">As ZdNet reported, WhatsApp reached the one billion active monthly user milestone a year ago, and now has 1.3 billion monthly active users, most of whom use it daily, according to WhatsApp.</span><br></p>', '2021-03-21 13:39:37', '2021-03-24 11:52:15', 1, 'WhatsApp:-Now-one-billion-people-send-55-billion-messages-per-day', 'aedf042e6b985cbc9753fd32c5902224.png', NULL, 15, 0),
(18, 'Miss USA Welcomes First Openly Transgender Contestant', 13, 12, '<p><span class=\"surtitre\"><p>While transgender \r\nsoldiers are currently suing President Trump over the administrations \r\nban on transgender people serving in the military, it appears the \r\npresidents appointment to office has given one transgender individual \r\nthe fuel to fight for greater acceptance in society.</p></span>\r\n\r\n<br></p><div class=\"col col-lg-12\">\r\n<div class=\"fulltext margintop10\">\r\n<p>Beauty pageant hopeful Anita Green will become the first transgender \r\nperson to ever compete in Miss Montana USA on Saturday - an accolade \r\nshes fought for as part of her mission to re-educate society on what it\r\n means to be a beauty queen.</p>\r\n<p>I can definitely tell you that when Trump was elected into office, I\r\n knew that I needed to step up and do this, the 26-year-old told Mic.</p>\r\n<p>I was so nervous about this but I knew that I needed to compete. I \r\nwanted to be a positive role model in the community and instill a sense \r\nof hope within the trans community and give them some positive news, \r\nshe added.</p>\r\n<p>In 2012, Miss Universe finally allowed transgender contestants to compete.</p>\r\n<p>Kylan Arianna Wenzel is the only other transgender beauty queen \r\ncontestant to take part in a state pageant when she competed in Miss USA\r\n in California in 2013.</p>\r\n<p>However, this isnt the first time Green has made history.</p>\r\n<p>People reports the beauty queen contestant became the first \r\ntransgender delegate from Montana in 2016 when she was elected to cast \r\nher vote for Bernie Sanders at the Democratic National Convention.</p>\r\n<p>Green currently works with adults with disabilities and is using her role in the beauty contest to help the LGBTQI community.</p>\r\n<p>I hope that competing inspires other transgender people to feel \r\nconfident in themselves, and to feel comfortable to be who they are and \r\nnot be ashamed of their transgender status, she told the publication.</p>\r\n<p>I really wanted to make sure that my progressive message was heard on a much wider scale, she said.</p>\r\n<p>I think that the Miss Universe organisation is great for letting \r\nwomen have their voices heard. Women oftentimes have their voices \r\nsuppressed, and I think that the Miss Universe organization gives women \r\nthe opportunity to shine.</p></div></div><p><br></p>', '2021-03-21 14:19:30', '2021-03-23 17:23:39', 0, 'Miss-USA-Welcomes-First-Openly-Transgender-Contestant', '8a15a081eda89b513387910ff3baca58.jpg', NULL, 0, 0),
(19, 'Tour du Rwanda 2021 postponed ', 6, 8, '<p><span class=\"surtitre\"><p><i>Rwanda Cycling Federation (FERWACY) has postponed Tour du Rwanda 2021 that was scheduled to take from 21st to 28th February.</i></p></span>\r\n\r\n<br></p><div class=\"col col-lg-12\">\r\n<div class=\"fulltext margintop10\">\r\n<p>According to a statement signed by the President of FERWACY; Abdallah\r\n Murenzi, the tournament has been postponed due to current global \r\nsituation of COVID-19 pandemic and many uncertainties that do not allow\r\n to envisage the organization of the tour of Rwanda in the best \r\nconditions.</p>\r\n<p>After consultations with other government institutions, Rwanda \r\nCycling Federation has decided to postpone the 2021 edition of the Tour \r\ndu Rwanda initially scheduled on February 21st to 28th. The 2021 edition\r\n is rescheduled for the month of May (from 2nd to 9th), subject to the \r\nforthcoming validation of the dates, by the Union Cycliste \r\nInternationale-UCI, reads FERWACY statement.</p>\r\n<p>Despite the suspension, FERWACY revealed that preparations for Tour du Rwanda 2021 are actively continuing.</p>\r\n<p>Organizers of the upcoming Tour du Rwanda recently announced that the\r\n postponed tournament would attract the participation of 15 teams.</p>\r\n<p>Tour du Rwanda 2021 will be the third since it was upgraded to Union Cycliste Internationale (UCI) 2.1 category.</p>\r\n<p>Fifteen teams have been selected for the moment, from the major \r\ncycling nations of the African continent but also from worldwide \r\nexperienced teams competing in major cycling events on the international\r\n calendar like the prestigious Tour de France: among them the UCI World \r\nTour Israel Start-Up Nations the new team of Chris Froome, and the \r\nFrench Total-Direct Energie and B&amp;B Hotels.</p>\r\n<p>Rwanda will be represented by its National Team and with the two UCI \r\nContinental Teams Skol Adrien Cycling Academy and Benediction Cycling \r\nteam.</p>\r\n<p>Once again the route promises to be spectacular with long climbs on \r\nalmost all stages for a total elevation of 16,347 meters. The famous \r\nWall of Kigali and the Mount Kigali will be part of this exceptional \r\nprogram to make Tour du Rwanda, the most difficult race of the 2021 \r\nseason.</p>\r\n<p><strong>15 selected Teams</strong></p>\r\n<p><strong>World Tour:</strong> Israel Start-Up Nation (Israel)</p>\r\n<p><strong>Continental Pro UCI:</strong> Total-Direct Energie (France), B&amp;B Hotels (France), Team Novo Nordisk (USA), Androni-Giocatolli (Italy)</p>\r\n<p><strong>Continental UCI:</strong> Benediction Cycling Team (Rwanda), \r\nSkol Adrien Cycling Academy (Rwanda), Pro Touch Team (South Africa), \r\nBike Aid (Germany), Vino Astana Motors (Kazakhstan), Team Medellin \r\n(Colombia), TSG Terengganu (Malaysia)</p>\r\n<p><strong>National Teams:</strong> Rwanda, Algeria, Ethiopia</p></div></div><p><br></p>', '2021-03-21 15:22:37', '2021-03-23 17:24:22', 0, 'Tour-du-Rwanda-2021-postponed-', '02ae16c1212e032bb416678a898fbfdc.jpg', NULL, 0, 0),
